import { Navbar } from '../app/Navbar/Navbar';

export type LayoutProps = {
  activePage: string;
};

export function Layout(props: LayoutProps): JSX.Element {
  const [isSidebarOpen, setIsSidebarOpen] = useState(true);

  return (
    <Fragment>
      <Navbar />
      <Sidebar />
    </Fragment>
  );
}
